import "./App.css";
import { useEffect, useState } from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import axios from "axios";
// Pages :
import Home from "./pages/Home";
import Login from "./pages/Login";
import RegisteredUsers from "./pages/RegisteredUsers";
import Register from "./pages/Register";

function App() {
  const [chosenHospital, setChoosenHsopital] = useState("Welcome");

  const showHabibData = () => {
    // axios.get("https://dog.ceo/api/breeds/image/random").then((response) => {
    // const data = response.data.message;
    // console.log(data);
    // });

    setChoosenHsopital("Al-Habib");
  };
  const showManeaData = () => {
    console.log("this is Al-Habib Hospital");
    setChoosenHsopital("Al-Manea");
  };
  const showMowasatData = () => {
    console.log("this is Al-Habib Hospital");
    setChoosenHsopital("Al-Mowasat");
  };

  return (
    <Router>
      <body>
        <div>
          <header>
            <div className="links">
              <Link to="/login">Login</Link>
              <Link to="/register">Registeration</Link>

              <Link to="/">Home Page</Link>
              <h3 style={{ paddingLeft: 100 }}> {chosenHospital}</h3>
            </div>
            <Routes>
              <Route path="/" exact Component={Home}></Route>
              <Route path="/login" exact Component={Login}></Route>
              <Route path="/register" exact Component={Register}></Route>
            </Routes>

            <div className="dropdown">
              <button className="dropbtn">Hospitals</button>
              <div className="dropdown-content">
                <a href="#" onClick={showHabibData}>
                  Al-habib
                </a>
                <a href="#" onClick={showManeaData}>
                  Al-Manea
                </a>
                <a href="#" onClick={showMowasatData}>
                  Al-Mowasat
                </a>
              </div>
            </div>
          </header>
          <div className="column">
            <h2>Clinic Name</h2>
          </div>
          <div className="column">
            <h4>Physician PHOTO</h4>
            <h4>Physician Name</h4>
            <h4>Speciality</h4>
            <h4>Today Date</h4>
            <h4>Today Times</h4>
            <h4>--- -- -- ---- - -</h4>
          </div>
          <div className="column">
            <h4>Physician PHOTO</h4>
            <h4>Physician Name</h4>
            <h4>Speciality</h4>
            <h4>Today Date</h4>
            <h4>Today Times</h4>
            <h4>--- -- -- ---- - -</h4>
          </div>{" "}
          <div className="column">
            <h4>Physician PHOTO</h4>
            <h4>Physician Name</h4>
            <h4>Speciality</h4>
            <h4>Today Date</h4>
            <h4>Today Times</h4>
            <h4>--- -- -- ---- - -</h4>
          </div>
          {/* <footer>
        <p>Basseloob</p>
      </footer> */}
        </div>
      </body>
      //{" "}
      <div classNameName="App">
        //{" "}
        <Router>
          //{" "}
          <div className="navbar">
            //{" "}
            <div className="links">
              //{" "}
              <>
                // <Link to="/login">Login</Link>
                // <Link to="/register">Registeration</Link>
                //{" "}
              </>
              //{" "}
              <>
                // <Link to="/">Home Page</Link>
                // <h3 style={{ paddingLeft: 100 }}> {chosenHospital}</h3>
                //{" "}
              </>
              //{" "}
            </div>
            //{" "}
            <div className="dropdown">
              // <button className="dropbtn">Hospitals</button>
              //{" "}
              <div className="dropdown-content">
                //{" "}
                <a href="#" onClick={showHabibData}>
                  // Al-habib //{" "}
                </a>
                //{" "}
                <a href="#" onClick={showManeaData}>
                  // Al-Manea //{" "}
                </a>
                //{" "}
                <a href="#" onClick={showMowasatData}>
                  // Al-Mowasat //{" "}
                </a>
                //{" "}
              </div>
              //{" "}
            </div>
            //{" "}
          </div>
          //{" "}
          <Routes>
            // <Route path="/" exact Component={Home}></Route>
            // <Route path="/login" exact Component={Login}></Route>
            // <Route path="/register" exact Component={Register}></Route>
            //{" "}
          </Routes>
          //{" "}
        </Router>
        //{" "}
      </div>
    </Router>
  );
}

export default App;
